  constructor(props) {
    super(props);
    this.state = {
        isPlaying: false,
        isPaused: true,
        isStopped: false,
        soundStatus: Sound.status.STOPPED,
        soundfile: fmstatic,
        title: 'PRESS PLAY',
        id: 0,
        songlist: props.songlist,
        albumtitle: props.album,
        playButtonPressed: false,
        stopButtonPressed: false,
    };
  }

  handlePlayClick() {
  
    let isPausedNew = !this.state.isPaused

    this.setState( ({
      playButtonPressed: true,
      isPaused: isPausedNew
    }), () => {
      setTimeout( () => {
          this.setState( ({
            playButtonPressed: false,
        }));
      }, 1000);
    });


    isPausedNew 
    ? 
    (this.setState({isPlaying: false, soundStatus: Sound.status.PAUSED})) 
    : 
    (this.setState({isPlaying: true, soundStatus: Sound.status.PLAYING}))
    
    
    if (this.state.id === 0 ) {
      this.setState({id: 1, title: this.state.songlist[0].title, soundfile: this.state.songlist[0].audiofile})
    }

  }


  handleStopClick() {

    this.setState( ({
      stopButtonPressed: true,
      isPlaying: false, 
      isPaused: true, 
      isStopped: true, 
      soundStatus: Sound.status.STOPPED
    }), () => {
      setTimeout( () => {
          this.setState( ({
            stopButtonPressed: false,
        }));
      }, 1000);
    });

  }
